"rating":"4.5",
"reviewcomment":"Submarine Center is most definitely one of my favorite places in the city.  I stumbled upon it by complete accident when I moved to the area last year, and I&#39;ve been frequenting this place, and introducing friends to it, ever since.  <br><br>Before I even get into the food, big shoutout to the guys who work at this place.  The employees here are awesome!  Although sometimes I wonder if they ever go home or take days off, because it&#39;s the same amazing guys in there making sandwiches every time I go in.  But it&#39;s great to always be welcomed by friendly faces, and they&#39;ve even started to memorize my order (which is impressive, because this place is BUSY.)<br><br>The sandwiches are amazing.  Pretty basic, but there&#39;s just something about them that puts them above all the rest.  I do love how they stick all of the sandwiches in the oven for a few minutes to get the cheese nice and melted and they bread perfectly toasted.  <br><br>I could seriously go on for days about how much I love this place, but I&#39;ll refrain from writing an essay about sandwiches.  The place is very small and unsuspecting, but do NOT underestimate it! It&#39;s incredible.  It does get busy around lunch and dinner, but it&#39;s worth the wait.  It&#39;s also worth the drive out to West Portal if you don&#39;t already live out in that area of the city.  GO!  This is the easiest 5-stars I&#39;ve given on Yelp.",
