"reviewcomment":"I was recommended here and boy did they nail it! I made a reservation on <a href='/redir?url=http%3A%2F%2Fopentable.com&amp;s=897c359bd752b4f5407d5ea86453c82be2d1913c8d0b51b18d81fc58f52a6497' target='_blank' rel='nofollow'>opentable.com</a> which took a second and I&#39;d highly recommend it. The earliest I could be sat on a Saturday was at 9:45 which tells you that this place must be pretty good.<br><br>Very quiet and romantic setting for me and my date. They greeted me promptly and everyone was warm and friendly.<br><br>We started with the tiger prawn ravioli which was cooked in a light sauce and melted in your mouth. It was fantastic as it was unique.<br><br>She had the duck confit and I had the lamb. I expected a small dish being European but there was a good amount on my plate.<br>Her duck was good and tasty although my lamb was probably the best I have ever had. I&#39;m still thinking of this it!!!<br><br>It included a small bed of greens which were very flavorful as with the pommes landaise which were tasty but a tad but greasy.<br><br>All in all food was great, service was great and made for a great Saturday night. We didn&#39;t drink but the check wasn&#39;t even too bad either. Perfect place for a date in the city, hope to go back and tear up their filet!",
