"rating":"4.5",
"reviewcomment":"The food is not expensive,  but amazing. I have never been disappointed in any of their sandwiches.  My favorite at the moment is pork. And my girlfriends favorite is chicken. But we always cut them in half so we both get half of each. <br><br>I also love having no idea what any of the plastic wrapped goodies on the counter are. Sometimes when we are feeling ballsy we but one and eat it. Those are a lottery, cause even after eating them I couldn&#39;t tell you what they are. Sometimes they are sweet and some times, not so much.<br><br>They have puddings? In the fridge with jelly or nuts or something in them. They are in the bottom of the fridge, those are good too. But I also couldn&#39;t tell you what they are. <br><br>I guess I could ask what all of them are. But if you are there at lunch it&#39;s very fast, and if I&#39;m not, I feel like if I knew it would take some of the fun out of it! <br><br>Over all they are super fast at making the sandwiches and they are on top of remembering who ordered what with out a computer. I love it. I come here any time I am close.",
