"reviewcomment":"City Smoke House catered my boyfriend&#39;s surprise party earlier this year. My guests were very pleased with their meal (I had chefs at the party and they gave it the thumbs up). It was great to also have no delivery charge for being in SF. <br><br>Communication: We communicated primarily through email. I contacted them just about 2.5 weeks before the event. They were timely in all communications and incredibly responsive/helpful. When the gentleman came in to set up the food, he was on time and very polite. <br><br>Food: I opted for the 3 meat/3 side combo. I ordered for 23 people, but I probably could&#39;ve gotten away with ordering for 18-19 or a smaller combo. I ended up with more than 23 people and we had plenty of leftovers (if not almost too much).  I ordered the pulled pork, beef brisket and rotisserie chicken for the meat. The pulled pork and brisket were the stars of the meal. For the sides, mac &amp; cheese, baked beans and collard greens.",
