"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/VabrrWFgcSgrWtGEdMx_gQ/l.jpg",
"rating":"4.5",
"reviewcomment":"I wanted to hate on this place, because of it&#39;s buyout by Starbucks... but it&#39;s really good. <br><br>The variety of unique items they have is huge: herbed apricot hazelnut rolls, feta and green onion bread, fig and walnut loaves, bacon and pea quiche, jam tarts, etc, etc, etc. <br><br>The almond croissants are buttery and moist, and has almond paste filling on a few different layers inside. <br><br>The quiches have a puff-pastry type crust, not a crumbly shortbread like crust, which is not my personal preference, but they&#39;re still really good. All the quiches have a lot of the filling (bacon, veggies, cheese, etc), instead of being mostly egg), which I appreciate. <br><br>Every bread is good.<br><br>This is a place where you can grab a meal or individual baked goods to take home, both sweet and savory. <br><br>But it IS a bakery, if you come in at the very end of the day you might get something that&#39;s a little more dry or has absorbed flavors from something else it sat next to all day in the case -- that&#39;s just how bakeries work.",
