"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/R0zIYAyvlLP5uwm56cAmrA/l.jpg",
"rating":"4.5",
"reviewcomment":"Two words...pure wow! Such a little gem tucked in a residential neighborhood. Food and service was amazing!! The waiter really made our night...what a funny guy! <br>My friend was flying out of SFO and we tried to spend his last day here in SF doing touristy things. He has never tried French food in the US so of course I turned to yelp to find the perfect dining place.<br> We started off with 3 appetizers: a plate of cold cut/cured meat (procuitto, duck, chicken pâté, rabbit pâté, beef, pork butt rolled in bacon - forgive me but I don&#39;t remember all the fancy names for the meats but it was amazing!!), garlic butter escargot, beef tartare. Although I&#39;m not a beef eater myself, I heard the tartare is to die for. If my bf could, he would&#39;ve licked the plate clean. We ordered entrees to share: mussels in curry-garlic white wine w/side order of fries , medium rare duck over a bead of greens and potatoes with liqueur soaked cherries, and scallop risotto. Everything was just perfectly cooked and executed. The plating of every dish was beautiful. By the time we finished our meal, every plate was scraped clean. Who says you have to leave a tiny bit of food on your plate to be polite?!? Not us!  We were showing the chef we REALLY enjoyed every last bit of food. <br>    We ended the night with creme brûlée. It was silky and creamy- so rich and delicious! I will go back to try their strawberry in peppered balsamic vinegar. It was highly recommended but we didn&#39;t have space for 2 desserts.<br><br>I will be back soon!!! Loved everything about this place. :)",
