"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/IG6kNV4Bcc-iu2z4tjrEmw/l.jpg",
"rating":"4.5",
"reviewcomment":"Swan Oyster Depot was so small that the BF and I decided to order our meal to-go instead of waiting in the long line that was out the door. This place is the smallest I&#39;ve ever seen. I couldn&#39;t even go inside because it was packed with people sitting at the bar, people ordering to-go, and others waiting in line.<br><br>We ordered a small clam chowder, the salmon plate, and the seafood cocktail. All this came out to be $60-ish. Trust me, it was worth it! Cash only.<br><br>The salmon plate had fresh salmon slices topped with capers on top of thin, fresh, crunchy bread with a side of baby shrimps. We squeezed a little bit of lemon on top and it was amazing. I could eat 20 of these. The seafood cocktail was a bunch of seafood in this spicy (we asked for it to be spicy) and very flavorful cocktail sauce. The shrimp, oysters, crab, etc was so dang good and so fresh. I savored each and every bite. The clam chowder was just ok. I like my chowders thick and I thought this one was a little runny.<br>Service was quick and the guys were very nice and helpful. The wait looked to be very brutal but it judging by what I ate there, it&#39;s worth the wait if you&#39;re craving seafood. Check this yummy place out!",
