"rating":"4.5",
"reviewcomment":"Another bookmark checked off! <br><br>Chez maman - you were not a disappointment. <br><br>Small place - we came for dinner on a Saturday night &amp; waited for maybe 25 minutes. They have 2 little tables outside and inside there is a large counter that people sit &amp; eat at. Kind of a fancy diner feel. I&#39;d say the whole place seats about 20 people at most. <br><br>I of course opted for the basic burger with the Brie cheese add on ($12.50). And no other way to have a burger than with fries on the side, the other option being salad. The fries were awesome! Very similar to how French fries are in France - very thin &amp; crisp. I loved them! They also gave us aioli dipping sauce. OMG. Love. <br><br>Now to the burger. Medium rare perfection! It was cooked perfectly to my request. Juicy goodness &amp; oh my did the Brie pair nicely with it! It was such a good meal. I felt no guilt afterwards. <br><br>Service was friendly and nice. He complimented me on my choice of meal and also on my appetite after he saw a clean plate after I ate. <br><br>Gourmet burger at it&#39;s finest!",
