"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/4rcXvUA2zvNod-tGHkmhgA/l.jpg",
"rating":"4.0",
"reviewcomment":"Restaurants with self-proclaimed &#34;best _____&#34; are usually overrated, but Sotto Mare&#39;s &#34;best damn crab cioppino&#34; simply stays true to its word. How much do I love this dish? The most recent time I came here with just one other person, I forgot that my friend was allergic to shellfish, so I ended up ordering the whole thing to myself! I had leftovers for lunch and dinner the next day, but totally worth it. At $41, this hearty cioppino is packed with pre-cracked crab, shrimp, scallops, mussels, clams, squid and penne noodles. Just a tip - save the bread they serve you at the beginning until the cioppino comes out, so you can dip it in the stew...amazing. <br><br>The restaurant itself is small, long and narrow, and is always busy. They only take reservations for parties of 3 or more, but luckily, both of the times I&#39;ve been with just one other person, we didn&#39;t have to wait. The service is always friendly and attentive, despite how busy it is! <br><br>Another thing to note - they offer a limited menu (no dessert), but the cioppino is seriously the only thing you need to order here.",
