"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/Zyt3tSwnyVsvo_7F3k6s4g/l.jpg",
"rating":"4.5",
"reviewcomment":"So I&#39;m not from Eastern Europe but all of my relatives / grandparents are - and this is the food I&#39;ve grown up with. Short and Sweet - it&#39;s very good and such a great new experience vs. going to the German Restaurants around town that don&#39;t take reservations and have gotten Americanized. This food is not spicy and it&#39;s not supposed to be. It&#39;s an excellent representation of what I grew up with - Pierogies and all. <br><br>I&#39;ve been bragging about this place to all of my friends and finally remembered to review it. ######HashTag LOVE IT. just jaggin bout the hash tags. <br><br>Stopped in here on a Sunday evening - all quiet on the western front - just a few tables seated. The owner and his waitress were working. My pally - my friend - Bob J on here highly touted this place - I looked at yelp and saw both good and bad - but you know - some people have really 5 Star expectations at a dive bar so you can&#39;t trust everyone. <br><br>The owner recommended a Czech beer that was delicious and I haven&#39;t seen it before at the other German/European jaunts that I go to on a regular so that was a nice surprise. <br><br>I ordered the Hungarian Goulash - a great word to say anytime of the day and it was very good. I will have it again definitely. My friend ordered the Homemade Pork Sausage and they were OUTSTANDING. <br><br>We finished with the Apple strudel and OMG it was soooooooo good. A perfect ending to any meal. I highly recommend and it&#39;s okay to wait a bit for your reservation - making a reservation on a Friday/Saturday night does not guarantee that you&#39;ll be sat at that very moment. It blows me away when people complain about having to wait on a weekend - take a seat at the bar, have a beer or a glass of wine and anticipate a hearty delicious meal. <br><br>Entrees are mostly 15 to 20. Extremely reasonably priced.",
