"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/9BqXJ6HBxHeOMyO2aJVz5Q/l.jpg",
"rating":"4.5",
"reviewcomment":"Gayle and I each took last Friday afternoon off and came into the City to see the Georgia O&#39;Keeffe Exhibit at the De Young. After that, we walked over to Park Chow for Lunch, and on a hunch I asked Gayle to see if there was an Arizmendi nearby. This small chain evolved from Berkeley&#39;s Cheese Board, and I&#39;ve been a regular patron of their shops in Emeryville, Oakland, and San Rafael.  And what do you know, this Inner Sunset Outpost was only a block or 2 away!<br><br>Gayle works for the City of Walnut Creek, and I&#39;m fond of pointing out that this Contra Costa County economic powerhouse will (in my eyes) remain a bakery backwater until an Arizmendi sets up shop there. In the meantime, I will continue to be &#34;forced&#34; to travel many miles for a chance to buy corn cherry scones, socialist pizza, and other gluten goodness. <br><br>We found that and more at this Arizmendi. This version seems smaller than the other ones, but with similar selections and consistently delicious versions. I picked out a half a dozen assorted scones for the week and left knowing that my upcoming mornings would start off on the right foot. Our extra bonus was the chocolate chip cookie that was wonderfully warm, melty, and tasty.",
