"reviewcomment":"This is literally my childhood.. In a white carton box filled with garlic fried rice, huge chunks of meat, pineapples and eggs LOL.<br><br>I grew up with my mom bringing these back to the homefort. She and the owner actually are friends now because she&#39;s a regular. Even until now, I find the kitchen filled with these darn breakfast boxes.<br><br>This place is literally a hole in the wall. The sign is so small and simple that you probably wouldn&#39;t even see it if you were driving. But the workers there are really nice.<br><br>Maybe it&#39;s the Filipino in me, but goodness I la-la-love silogs, even if it&#39;s not made from Filipinos. The people here make a mean silog for an amazingly nice price ( one box is like $3 I think) <br><br>I&#39;ve tried practically every silog in this joint, but my favorite is their tapsilog and their bangus sisilog. Salty but it keeps you wanting a crapload more. They always ask if you want tomatoes or pineapples with your order and I opt for pineapples, because I have this thing for pairing up salty foods with sweet foods.<br><br>Parking is horrible in Excelsior. Either call ahead and pick up or pray to God that there is parking someplace. They only accept cash, so fill up them pockets.",
