"rating":"4.5",
"reviewcomment":"Came for dinner with my fiance. Great choice! <br><br>Green  string farm. Daily crop. Poached egg hollandaise sauce candied Fennel rye croutons. Local greens and potato and garlic all roasted..  Tasty! <br><br>Potato dumpling kumla. Onion ragout. Lingonberry. Lardon . Brown butter. Individually, the components were OK, but when you took a bite and it had a bit of everything including the lardon, it s amazing! All for the lardon on the side  so that it stays crispy! <br><br>Skrieg, wild Arctic cod. Sunchoke cream. Salmon roe sorrel chanterelle mushroom. Just like the potato dumpling, take a bite with a little bit of everything, amazing  the fish alone was buttery and delish!! <br><br>Squab breast. Potato florette. Cabbage forest mushroom. Lemon tarragon jus. The squab was made two ways, roasted and also confit, juicy tasty meat. The bone in leg was a bit hard to eat off the bone since it&#39;s cooked to a medium rare. But still yummy. A bit sad for me since the bone is always my favorite part. <br><br>Pretty decor. I love this place. Will have to come back as we both have a lot of other dishes we want to try!",
