"rating":"4.5",
"reviewcomment":"I&#39;ve finally found a good sandwich shop in my hometown! Daly City doesn&#39;t have much to offer in the restaurant business, so finding a gem like Sam&#39;s really makes me happy. My sister and I had some time to kill while waiting for our car to get washed at Touchless Car Wash. Immediately, we were greeted by a really friendly male (I&#39;m assuming it was Sam?) and he explained to us that the sandwiches were made to order and directed us to the check off cards. We ended up getting a toasted Turkey sandwich on Dutch Crunch with mayo, lettuce, tomatoes, provolone cheese and their delicious pesto sauce. Our total was about $7-$8 which wasn&#39;t bad. The sandwiches at Sam&#39;s are delicious and filling! <br><br>I was really impressed with the service and products that I ended up visiting the next day. The same male employee remembered me and thanked me for coming back! You&#39;ll be seeing me on the regular check in list, Sam! Great products, even better prices, and friendly service.. what more could you ask for?!",
