"rating":"4.0",
"reviewcomment":"Lovely place! Went here with some wonderful people for a packed wine tasting and learned a lot. We also stayed and shared some of the food there. We ordered the gnocchi, wild boar with polenta and grilled veggies, and arugula salad. Everything tasted amazing and was fresh. My favorite was the wild boar... OMG. I seriously think about the flavors that satiates my mouth with each bite. I, honestly cut the pieces of the boar into smaller pieces (when I was running low) so that my evening can continue to be heightened with such wonderful, bursting flavors and each little bite was heavenly. Mmm!!! Such a warm and inviting place with delectable dishes. I&#39;d definitely would love to come here again... and I will! :)<br><br>Also, I didn&#39;t know this but when you order the food, don&#39;t expect huge portions or a big meal because they&#39;re supposed to be small plates. Oh, and I think it&#39;s wonderful that they have a night where parents (it is Bernal Heights where lots of parents with babies live) can bring their babies in, without having to pay a babysitter for the evening and enjoy themselves with a glass or two of wine. (applause) What a great idea!",
