"rating":"4.0",
"reviewcomment":"I came here with two of my girlfriends last week and all three of us enjoyed our experience here. <br><br>First of all, the service was excellent. All of the staff was extremely attentive, friendly and nice. They ensured that our water glasses were also full and brought us everything we needed. <br><br>We chose the prix fixe menu, which included an appetizer, main dish and dessert for $38. We chose to get three different kids of appetizers (see pictures) and shared them. The portions were just right. My favorite were the truffle, Parmesan Brussels sprouts. The flavor was extraordinary and I love how each bite had just enough crisp. For my main dish I had their Hawaiian Ono Fish - well done. I&#39;m usually really scared with the fish I order at restaurants, but I had trust in my waitress that said it was delicious and similar to halibut. Instead of dessert, my friend and I ordered a side of kale in olive oil and lemon juice - perfectly cooked! One of my friends ordered dessert for us three to share - chocolate cake with a later of marshmallow... Amaze! We licked every last bit of it. <br><br>If you&#39;re visiting SF or are in the area, you must come here. Parking wasn&#39;t hard at all!",
