"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/t6DqumJleWxUdnzAYL_rFw/l.jpg",
"rating":"4.0",
"reviewcomment":"Another great find in the wonderful streets of San Francisco!  My good friend took me to this place and told me that I must try the AK Decadence.  It is essentially a turkey and avocado sandwich...but better than you would imagine!<br><br>This deli is a small shop on what is seemingly a busy street.  In fact, (without my glasses) I didn&#39;t even spot it when we got out of the car.  It is, like so many things in SF, a locally owned gem that has a great product at a reasonable price.  My sandwich was $7, so it was more expensive than the infamous $5 foot long, but it was SO much better!<br><br>The meats, fish, and other items were all presented in a clean, visually-appealing way.  To top it off, the owner was actually super friendly!  Customer service seems to be a lost art today, but a simple smile and thank you was more than enough for me to come back again!<br><br>If you haven&#39;t already tried AK Meats, you must do so!  ...Today!",
"reviewcount":"176",
