"rating":"4.5",
"reviewcomment":"My son and I share this 5 star feeling. <br><br>I mean it&#39;s a $5 hot dog in the middle of Market Street and it tastes great, everything is super clean. <br><br>If you put the same customer service in a restaurant where I&#39;m spending $20 for lunch, yeah I&#39;d say the guy could step up his game. <br><br>Is he waking up at the crack of dawn, setting up a stand, cooking hot dogs while the least savory flavors of people harass him for free food that isn&#39;t even ready yet? Then he has to stand all day, keep his cart from blowing away, listen to that damn cable car bell all day and can&#39;t go anywhere else until it&#39;s time to clean up and put the cart away? Yes! So he doesn&#39;t have to be Mary f&#39;n Poppins, just a nice enough dude who helps you get your lips and a-hole quota. You want kraut or red onions on that?<br><br>Buy these dogs, you&#39;ll like them a lot. I recommend the Hot Link",
