"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/qc-liLEv7szRa6eMsgcC9g/l.jpg",
"rating":"4.0",
"reviewcomment":"What a relief to have Another Cafe in this city! The first time I heard of this spot I was eavesdropping in another conversation in another cafe. (No pun intended. And yes, I&#39;m aware that last comment sounded super creepster-y. I mean, they were talking loudly anyway...)  Someone asked the barista of a coffeehouse open beyond 8 and they suggested Another Cafe. I Yelp bookmarked it, visited it, and have remained a happy customer since. <br><br>Located at the corner of Pine and Leavenworth, Another Cafe is two stories. It doesn&#39;t look very big from the outside, but it is. The bottom floor has long community tables with stools and numerous 2-people tables. Upstairs there is limited seating; they are definitely appropriate for studying. Another Cafe serves Bicycle Coffee and like others have noted, their beverage and food prices are reasonable. But what distinguishes Another Cafe from other places is the service and ambiance. The baristas are incredibly friendly and probably the nicest ones I can think of in this city. They also bump good music. One minute it&#39;s R&amp;B, next it&#39;s rock, and then it&#39;s folk. Along with that, the environment is unpretentious and relaxed.",
