"rating":"4.0",
"reviewcomment":"all i can say is WOW, why am i just NOW to this place 29 years into my life!<br><br>every thing tasted amazing and rich in flavor. you will be torn on how you want to use the space in your stomach, whether to get more buffet items (Brazilian  chicken salad and black bean stew were great! even the white rice!) or more amazing meats. its hard to remember all the ones i got, but from the top of my head, the beef rib, bacon wrapped fillet, bacon wrapped chicken, top sirloin were my favorites...<br><br>the service was top notch, when you have the green &#34;yes please&#34; sign on, they&#39;ll keep bringing you different meats within 3 mins and alot of times back to back to back.<br><br>it was also my birthday the day i went, so the gave a complimentary ice dessert and song, <br><br>price is up there (i think $54 per person all you can it) but definitely worth it, very good for special occasions, i will be back and will definitely be happy to spend that type of money. overall this is a must-got-to place for any real foodie out there! oh yea and its street parking only, i got lucky and found a spot within a block in an alley.",
