"rating":"4.0",
"reviewcomment":"I had 90 minutes to eat lunch, and was standing against my will in the line up wiht 100 others to dine at Sushirrito when suddenly I remembered &#34;I don&#39;t really like this place&#34; (see my review). My wonderful Austin BFF had a similar revelation and we quickly escaped the line up and jogged up the street to The Sentinal for a stellar sammie (or two).<br><br>Entering from the side entrance the menu is printed on paper and posted outside so you can make snap decisions when you get to the counter. I was torn between the Reuben and the Lamb and feta meatball sandwich.... just kidding, easiest decision EVER!!!<br><br>3-4 large light meatballs sit within a freshly baked brioche bun (almost a croissant in texture and buttery flavour - FML), a little sauce, A LOT of cheese and some basil leaves - HOT DAMN!!!<br><br>For the girth and density of this sandwich it was actually quite light. The meatballs were delicous... nay, scrumptious.... nay... I&#39;m going to make up a word right now to describe the flavour.... right off the top of my head, SCRUM-TRU-LESCENT!<br><br>Yes. Simply Scrumtrulescent. Done!<br><br>Eat here. Don&#39;t be weird. Just eat here. They give you free pickles and Werthers Original candy with every order!",
