"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/P4HCpfpFYWLyCnYIowTjLQ/l.jpg",
"rating":"4.0",
"reviewcomment":"I stumbled upon Kabuto while yelping a place for dinner tonight; it is now one of my favorite sushi restaurants. <br><br>It&#39;s a pretty small place with about 8 seats at the sushi bar and 5 tables.  Luckily, my bf and I got there before the dinner rush and scored a couple seats at the sushi bar.<br><br>The service was sharp and our server was helpful and seemed to genuinely enjoy her job, which is always a plus.<br><br>The food was outstanding and the fish was some of the freshest I have ever had.  In addition to their dinner menu, they also have a menu called &#34;Special Sushi&#34; which contains a collection of their unique dishes.  And, in addition to that, there is a board above their sushi bar listing the evening&#39;s specials.  With so many choices and a limited stomach capacity, it was hard to know what to order.  We end up getting a sampling of their sashimi and &#34;special sushi&#34;. <br><br>You must try:<br> - Hamachi Pear (yellowtail topped with sliced pear and a fruity mustard sauce)<br> - Saikyo Sushi (grilled marinated black cod served with yuzu-kosho gravy)<br> - Wahoo (Ono) sashimi<br> - Tasmanian Salmon sashimi  <br><br>I cannot wait to go back and try more of their unique dishes and extremely fresh fish!",
