"rating":"4.0",
"reviewcomment":"So I just started this thing called Coffee Meets Bagel and saw this place serves bagels for breakfast so I thought it be a fun place to meet my &#34;bagel&#34; here. <br><br>I waited for 40 minutes. No show. No text saying she&#39;d be late...no response. So while I was waiting I looked over the entire menu, observed the folks casually enjoying their morning brews in the parklet seating area, and checked out some of the small details of the shop. <br><br>This place is like the perfect combination of things: bike shop, coffee shop, good food, and even beer with a happy hour! Can this place be more hipster than that?! <br><br>Anyway, I chalked up the date as a loss and ordered myself a breakfast bagel to go and went home. The bagel hit the spot and I&#39;m glad that I at least got to enjoy some kind of bagel! <br><br>I shall return! Hopefully I&#39;ll have a more successful bagel and check out the little garden in the back. Oh! And don&#39;t forget that the cafe is cash only.",
