"rating":"4.0",
"reviewcomment":"Wow. So good that I feel the need to write a review in the middle of my meal here!<br>I completely understand why Quince got upgraded to a Michelin 2 star last year.  Definitely everything I have come to expect from restaurants at this level. Incredible service, intricate, imaginative dishes and elegant ambience. I am dining here by myself and the staff has made me feel very comfortable and welcome. <br>Many 2 and 3 star restaurants where I have eaten are usually excellent but seem to imitate the Ferran Adria\ Thomas Keller style. While I am not denigrating this in any way (to the contrary) it is a delight to experience haute cuisine that borrows from this school but also creates something very unique. The menu seems to very much express the current season (spring) without being too light. Quite expensive but if you are a true foodie it&#39;s worth every penny. Epic.<br>Well, time to get back to the food!",
