"rating":"4.5",
"reviewcomment":"I LOVE this place!!! My bf and I discovered this place when we were on a healthy kick last summer and decided to give it a try. We&#39;ve never once regretted it. All the items are delicious AND healthy for you! Best part is that the calories are already calculated and laid out for you to see to have a better idea of what to choose and how much. We both keep coming back to our two faves: the meatloaf and the bulgar with wild mushrooms. Yum yum! <br><br>We&#39;ve met and spoken with the owner several times. Everyone that works there is super nice, friendly, and helpful. It&#39;s just such a shame that this is the only location as it&#39;s a bit of a drive for us, but we willingly make the trek every month or so.<br><br>Parking is fine during the day time, but as evening approaches it becomes increasingly difficult. <br><br>I think the prices are fair given how much you would spend at another fast food joint for much less healthy food. But no kidding - the clean living can cost you a couple of pretty pennies. <br><br>I&#39;m so in love with this place, I swear even their WATER is phenomenal! :P Please try this place out if you&#39;re considering. Also, you can take extras to go to heat up another night - one less drive to go though!",
