"rating":"4.0",
"reviewcomment":"Sometimes I really want to see genuinely nice people do well in the food truck industry, assuming the food is the key component in their success. <br><br>Ryoji and the Sarunos are an amazing blend of both. I&#39;ve probably been there 5 or so times now over the course of a year and a half, and have to say that not only were they as good as before, but even better.<br><br>Today I had the usual Menchi w/fries, in which case they use 100% Organic Grass fed Beef now. The fries were amazingly better than I remember for some reason (crisp outside, fluffy inside), and the Menchi Burger was on par and a bit better than the last few times. I can only describe it as a grease-less, airy, perfect burger.<br><br>The Japanese Reggae music playing outside on a nice day even made it that much more awesome.<br><br>These guys are awesome. A great example of Japanese cuisine, done very consistently and to the best of one&#39;s ability, while striding to improve the same few menu offerings through one&#39;s lifetime.",
