"rating":"4.0",
"reviewcomment":"This is my second review for sea biscuit.  First review was tepid--good spot, but the coffee was a bit underwhelming for the price.  <br><br>However, the sandwiches here are hands down all-time.  Recently went with the Sea Biscut on the recommendation of staff.  Hot pastrami, gouda and avocado, mustard, mayo, romain onion, banana pepper, really lean boars head, and a semmifreddy dutch crunch roll.  <br><br>Staff says this young spot (4 months) serves mostly a neighborhood clientele here in the outer sunset.  But if you are looking for a destination sandwich spot, and think you know the best in San Francisco, then you must come here to test your palate.  Sandwich is a hands down 5.<br><br>Solid crew woking the sandwich line and coffee bar.  <br><br>Out of hood beach goers need to know this spot.<br><br>Sandwiches are 7-8 bucks, really fair considering how big they are.  Split one with a drink and it&#39;s a proper, filling but not stuffing lunch.<br><br>Their reputation is growing.  I&#39;ve heard several people in the past weeks speak similarly about their sandwiches.",
