"reviewcomment":"We had Firetrail Pizza cater our wedding at Wellington&#39;s Wine Bar, and they did a terrific job!  They worked with us to pick pizzas we all liked, and even made a custom pizza based just on a description of a pizza we liked at a bar in SF, which we found very accommodating and helpful.  Firetrail even coordinated the place setting rental for the wedding reception, and helped cut and serve ice cream and the cake we brought in!  Jed, Krissy and the Firetrail staff worked very hard to make sure everyone was well fed, and brought everything out at exactly the times we&#39;d asked for.<br><br>Of course, most importantly, the pizza and appetizers were DELICIOUS!  No picture can capture how good this thin crust pizza right out of the oven is.  And I highly suggest the bacon wrapped shrimp, which had our guests literally sending emails the next week to say how much they enjoyed it.<br><br>Definitely try their food truck at SOMA Streat Park, and use them for great pizza at your next event!",
